import React from 'react';
const Quiz = () => {
    const question = {
      text: "What is your favorite color?",
      options: ["Red", "Green", "Blue", "Yellow"]
    };
  

    return (
        <div>
          <h1>Online Quiz</h1>
          <Quiz question={question} />
        </div>
      );
    };
    

export default Quiz;
